    getCellType(x, y) {
        const currentMap = this.getCurrentMap();
        if (y >= 0 && y < currentMap.length && x >= 0 && x < currentMap[0].length) {
            return currentMap[y][x];
        }
        return CELL_TYPES.WALL;
    }

    // Установить тип ячейки по координатам
    setCellType(x, y, type) {
        const currentMap = this.getCurrentMap();
        if (y >= 0 && y < currentMap.length && x >= 0 && x < currentMap[0].length) {
            currentMap[y][x] = type;
        }
    }
